const outputElement = document.getElementById('output');
const cursorElement = document.getElementById('cursor');
const glitchImageContainer = document.getElementById('glitch-image-container');
const glitchImage = document.getElementById('glitch-image');

const mainTextElement = document.createElement('div');
mainTextElement.id = 'main-text';
outputElement.appendChild(mainTextElement);

const hexContainer = document.createElement('div');
hexContainer.id = 'hex-container';
outputElement.appendChild(hexContainer);

// Fake loading sequence
const bootSequence = [
    'Initializing system...',
    '[ASCII_ARTLOGO]',
    'Loading modules...',
    'Executing insight_Aug30.exe...',
    'Compiling...',
    'Error: Undefined variable "I"',
    'Recompiling with debug mode...',
    'Execution complete.\n'
];

// Main philosophical text split into paragraphs
const textContent = [
    'WHAT IS THE I?\n',
    '[ASCII_ART]',
    'When I say "I," I\'m referring to a subject that is \ndefined by a fundamental lack and a constant process \nof self-relating negativity...',
    '[ASCII_ART]',
    'This "I" is not a substantial entity with fixed qualities, \nbut a void: an emptiness that can only be understood \nthrough its own perpetual self-negation.',
    '[ASCII_ART]',
    'The Subject emerges as a distinct entity by differentiating \nitself from the external world, but this very act of \ndifferentiation introduces a split within the subject itself.',
    '[ASCII_ART]',
    'The external difference that separates me from others and \nguarantees my identity is simultaneously the internal \ndifference that divides me from myself.',
    '[ASCII_ART]',
    'This "Otherness" that I differentiate from myself is taken \ninto my own identity, "not-I".',
    '[ASCII_ART]',
    'We are always-already in a state of tension and contradiction, \ncaught between the desire for wholeness and the \nimpossibility of ever achieving it,',
    '[ASCII_ART]',
    'because wholeness is structurally impossible due to the \ncontradiction of identity.',
    '[ASCII_ART]'
];

const fullContent = bootSequence.concat(textContent);

let lineIndex = 0;
let charIndex = 0;
let textSpeed = 10;
let asciiArtIndex = 0;

function scrollToBottom() {
    const terminal = document.getElementById('terminal');
    terminal.scrollTop = terminal.scrollHeight;
}

let glitchingEnabled = false;

function typeLine() {
    if (lineIndex < fullContent.length) {
        let currentLine = fullContent[lineIndex];

        if (currentLine === '[ASCII_ART]') {
            // Display regular ASCII art
            mainTextElement.innerHTML += `<div class="ascii-art-container"><pre class="ascii-art ascii-art-regular">${asciiArt[asciiArtIndex]}</pre></div><br>`;
            asciiArtIndex = (asciiArtIndex + 1) % asciiArt.length;
            lineIndex++;
            scrollToBottom();
            setTimeout(typeLine, textSpeed * 20);
        } else if (currentLine === '[ASCII_ARTLOGO]') {
            // Display ASCII LOGO art
            mainTextElement.innerHTML += `<div class="ascii-art-container"><pre class="ascii-art ascii-art-logo">${logoAsciiArt}</pre></div>`;
            lineIndex++;
            scrollToBottom();
            setTimeout(typeLine, textSpeed * 20);
        } else if (charIndex < currentLine.length) {
            // Type out text character by character
            mainTextElement.innerHTML += currentLine.charAt(charIndex);
            charIndex++;
            scrollToBottom();
            setTimeout(typeLine, textSpeed);
        } else {
            // Move to next line
            mainTextElement.innerHTML += '<br>';
            charIndex = 0;
            lineIndex++;
            scrollToBottom();

            // Check if this line was "Execution complete."
            if (currentLine.trim() === 'Execution complete.') {
                glitchingEnabled = true;
            }

            // Check if this is the last line
            if (lineIndex === fullContent.length) {
                setTimeout(() => {
                    glitchingEnabled = false;
                    cursorElement.style.display = 'none'; // Hide cursor when finished
                }, 2000); // Wait 2 seconds before stopping glitches
            }

            setTimeout(typeLine, textSpeed * 3); // Slight pause between lines
        }

        // Random glitch effect only if enabled
        if (glitchingEnabled && Math.random() < 0.01) {
            showGlitchImage();
        }
    }
}

function scrollToBottom() {
    window.scrollTo(0, document.body.scrollHeight);
}

function createFallingHex() {
    const fallingSpan = document.createElement('span');
    fallingSpan.className = 'falling-hex';
    fallingSpan.style.left = `${Math.random() * 100}%`;
    fallingSpan.style.top = `${Math.random() * 100}%`;
    fallingSpan.textContent = generateRandomHex(Math.floor(Math.random() * 20) + 5);
    hexContainer.appendChild(fallingSpan);

    setTimeout(() => {
        fallingSpan.remove();
    }, Math.random() * 3000 + 1000);
}

function generateRandomHex(length) {
    const hexChars = '0123456789ABCDEF';
    let result = '';
    for (let i = 0; i < length; i++) {
        result += hexChars.charAt(Math.floor(Math.random() * hexChars.length));
    }
    return result;
}

function showGlitchImage() {
    const glitchImages = ['glitch.jpg','photo1.jpg', 'photo2.jpg', 'photo3.jpg', 'photo4.jpg'];
    const randomImage = glitchImages[Math.floor(Math.random() * glitchImages.length)];
    glitchImage.src = randomImage;
    glitchImageContainer.style.display = 'flex';
    setTimeout(() => {
        glitchImageContainer.style.display = 'none';
    }, 500);
}

window.onload = function() {
    typeLine();
    setInterval(createFallingHex, 100);
};


